import './App.css';
import TextField from '@mui/material/TextField';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>THINGS TO DO</h1>
        <div style={{display:"block"}}>
        <TextField id="outlined-basic" label="Outlined" variant="outlined"  defaultValue="Add More" style={{marginLeft:'20%',marginRight:'20%'}} />
        </div>
        <button>Done</button>
      </header>
    </div>
  );
}

export default App;
